  false,\n\t\"url\": null,\n\t\"notes\": \"BRIDGES_COUNTY_INDOT_IN is a point shapefile
  that contains locations of all county and city bridges in Indiana, provided by personnel
  of Indiana Department of Transportation (INDOT), Business Information and Technology
  Systems, GIS Mapping. The data set provided by INDOT was in an ESRI shapefile format
  and was named \"COUNTYBRIDGES.\" BRIDGES_COUNTY_INDOT_IN is attributed with national
  bridge identification (NBI) numbers. The following is excerpted from the metadata
  provided by INDOT for the source shapefile COUNTYBRIDGES.SHP: \"CountyBridges.shp
  is a point shapefile that shows the location of county and city bridges. The data
  was generated at a scale of 1:2,000,000.\"\",\n\t\"license_title\": null,\n\t\"extras\":
